def generate_orthogonal_vectors(k: int) -> list[str]:
    """"""
    a = [1, -1]
    b = [1, 1]
    X = [a, b]

    def get_xor(v):
        return [-1 * x for x in v]

    def build(X):
        ans = []
        n = len(X)
        for i in range(0, n, 2):
            ans.extend([X[i] + X[i + 1], X[i + 1] + X[i], get_xor(X[i]) + X[i + 1], X[i + 1] + get_xor(X[i])])
        return ans
    cur = 1
    if k == 0:
        return ['+']
    else:
        while cur < k:
            X = build(X)
            cur += 1
    result = []
    for v in X:
        result.append(''.join(['*' if x == -1 else '+' for x in v]))
    return result
